import {userLogin,registration} from "./type";


export const loginUser = (payload) => {
    debugger;
    return {
        type:userLogin,
        payload:{
            loginDetail:payload
        }
    }
}
export const registrationDetail = (payload) => {
    debugger;
    return {
        type:registration,
        payload:{
            registrationDetail:payload
        }
    }
}
